import React, { useState, createContext } from 'react';

const App = () => {
  const [user, setUser] = useState<User>();
  return (
    <React.StrictMode>
      <UserContext.Provider value={{ user, setUser }}>
        <Router>
          <NavBar />
          <Switch>
            <Route
              exact
              path="/"
            >
              <Login />
            </Route>
            <Route path="/home">
              <Home />
            </Route>
            <Route>
              <NotFound />
            </Route>
          </Switch>
        </Router>
      </UserContext.Provider>
    </React.StrictMode>
  );
};

export default App;
